// src/pages/PetList.jsx
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function PetList() {
  const [pets, setPets] = useState([]);

  useEffect(() => {
    api.get('/api/pets') // ✅ corrigido aqui
      .then((response) => {
        setPets(response.data);
      })
      .catch((err) => {
        console.error('Erro ao buscar pets:', err);
      });
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Pets Cadastrados</h2>
        <div>
          <Link to="/" className="btn btn-secondary me-2">Voltar ao Início</Link>
          <Link to="/pets/novo" className="btn btn-primary">Cadastrar Novo Pet</Link>
        </div>
      </div>

      <ul className="list-group">
        {pets.map((pet) => (
          <li key={pet._id} className="list-group-item d-flex justify-content-between align-items-center">
            <Link to={`/pets/${pet._id}`} style={{ textDecoration: 'none', color: 'inherit' }}>
              {pet.nome}
            </Link>
            <div>
              <Link to={`/pets/${pet._id}/editar`} className="btn btn-sm btn-outline-primary me-2">Editar</Link>
              <Link to={`/pets/${pet._id}/excluir`} className="btn btn-sm btn-outline-danger">Excluir</Link>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}
